product34 = Refinery::Ironman::Product.create!(product_no:'12667GR', name:'Ford Ranger PJ-PK Front Shock Absorber - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', specifications_attributes:[{title:'Package Details', value:'Each'}, {title:'Price Per Vehicle', value:'200'}], price:'110') if not '12667GR'.blank?;	vehicle34 = Refinery::Ironman::Vehicle.find_by_name('PJ-PK 2007-2011');	product34.vehicles << vehicle34 if vehicle34.present? and product34.present?;	category34 = Refinery::Ironman::Category.find_by_name('Shock Absorbers');	product34.categories << category34 if category34.present? and product34.present?
