product36 = Refinery::Ironman::Product.create!(product_no:'MAZDA014', name:'Ford Ranger PJ-PK Front Torsion Bars', description:'Ironman Torsion Bars are thicker than standard torsion bars fitted as original equipment. Original equipment torsion bars are designed to carry the weight of the vehicle as designed by their manufacturer. The adjustment incorporated in torsion bar vehicles is not intended to be used to compensate for carrying additional load. Additional 4x4 accessories such as a bull bar, winches and dual battery kit places enormous stress on standard torsion bars. Being uprated (thicker spring steel) Ironman torsion bars enhance ride comfort by controlling suspension travel whether carrying additional accessories or a full load of passengers. Ironman torsion bars will make your 4x4 safer while providing more comfortable cornering and braking efficiency. All Ironman torsion bars have upset forged ends and are pre set to minimise sag.', notes:'Duratorq Engine|||MAZDA014 is 1024mm in length, used on most vehicles. Vehicles with 2.5L WLT Engine use MAZDA005 (924mm) Torsion Bar.|||Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.', specifications_attributes:[{title:'Package Details', value:'Pair'}, {title:'Price Per Vehicle', value:'290'}], price:'319') if not 'MAZDA014'.blank?;	vehicle36 = Refinery::Ironman::Vehicle.find_by_name('PJ-PK 2007-2011');	product36.vehicles << vehicle36 if vehicle36.present? and product36.present?;	category36 = Refinery::Ironman::Category.find_by_name('Torsion Bars');	product36.categories << category36 if category36.present? and product36.present?
