product1703 = Refinery::Ironman::Product.create!(product_no:'12791GR', name:'Navara D22 Front Shock Absorber - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'Upper control arm may contact with front shock absorber. It may be necessary to grind away a small amount of material from the control arm to create more clearance.', specifications_attributes:[{title:'Package Details', value:'Each'}, {title:'Price Per Vehicle', value:'200'}], price:'110') if not '12791GR'.blank?;	vehicle1703 = Refinery::Ironman::Vehicle.find_by_name('D22');	product1703.vehicles << vehicle1703 if vehicle1703.present? and product1703.present?;	category1703 = Refinery::Ironman::Category.find_by_name('Shock Absorbers');	product1703.categories << category1703 if category1703.present? and product1703.present?
