product2083 = Refinery::Ironman::Product.create!(product_no:'12764GR LH', name:'Hilux 2WD 3/2005+ Front Strut - Nitro Gas - Left Side', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'Height Adjustable Spring Seat (with trim packer)|||Unnesessary fitment of trim packers may lift vehicle too high.|||Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.', specifications_attributes:[{title:'Additional Load', value:'Left Side'}, {title:'Package Details', value:'Each'}, {title:'Price Per Vehicle', value:'150'}], price:'165') if not '12764GR LH'.blank?;	vehicle2083 = Refinery::Ironman::Vehicle.find_by_name('2WD 2005+');	product2083.vehicles << vehicle2083 if vehicle2083.present? and product2083.present?;	category2083 = Refinery::Ironman::Category.find_by_name('Shock Absorbers');	product2083.categories << category2083 if category2083.present? and product2083.present?
