product2343 = Refinery::Ironman::Product.create!(product_no:'1144SK', name:'Landcruiser 71 Series Polyurethane Caster Bush Kit', description:'2° Caster Correction Bushes are available for selected vehicles. Produced from high density injection moulded polyurethane. Highly recommended for raised height 4x4`s up to 75mm lift to permanently cure vehicle wonder. 2 Degree Caster Correction Bushes are available for selected vehicles.', notes:'2 Degree Offset|||Adjustment is achieved by the rotation position of the inner steel tube. Caster angle is the backward or forward tilt of the differential steering axis. Positive caster is needed in most applications within front suspension in 4x4 vehicles. When a vehicle is lifted via raised springs, this positive angle is reduced. The reduced caster angle will detract feeling and response through the steering wheel. This will also cause reduced self-centring and possible wheel shimmy in extreme cases. The offset in the bushes will tilt the differential (positive) back toward manufacturers specification thus greatly improved handling and feel. Highly recommended for raised height 4x4`s up to 75mm lift to permanently cure vehicle wonder.|||', specifications_attributes:[{title:'Package Details', value:'Set'}, {title:'Price Per Vehicle', value:'110'}], price:'121') if not '1144SK'.blank?;	vehicle2343 = Refinery::Ironman::Vehicle.find_by_name('71 Series');	product2343.vehicles << vehicle2343 if vehicle2343.present? and product2343.present?;	category2343 = Refinery::Ironman::Category.find_by_name('Caster Correction');	product2343.categories << category2343 if category2343.present? and product2343.present?
