product2666 = Refinery::Ironman::Product.create!(product_no:'12682GR', name:'Landcruiser 105 Series Rear Shock Absorber - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', specifications_attributes:[{title:'Package Details', value:'Each'}, {title:'Price Per Vehicle', value:'200'}], price:'110') if not '12682GR'.blank?;	vehicle2666 = Refinery::Ironman::Vehicle.find_by_name('105 Series');	product2666.vehicles << vehicle2666 if vehicle2666.present? and product2666.present?;	category2666 = Refinery::Ironman::Category.find_by_name('Shock Absorbers');	product2666.categories << category2666 if category2666.present? and product2666.present?
