product2706 = Refinery::Ironman::Product.create!(product_no:'12795GR', name:'Landcruiser 100 Series Front Shock Absorber - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', specifications_attributes:[{title:'Package Details', value:'Each'}, {title:'Price Per Vehicle', value:'200'}], price:'110') if not '12795GR'.blank?;	vehicle2706 = Refinery::Ironman::Vehicle.find_by_name('100 Series');	product2706.vehicles << vehicle2706 if vehicle2706.present? and product2706.present?;	category2706 = Refinery::Ironman::Category.find_by_name('Shock Absorbers');	product2706.categories << category2706 if category2706.present? and product2706.present?
product2707 = Refinery::Ironman::Product.create!(product_no:'24795FE', name:'Landcruiser 100 Series Front Shock Absorber - Foam Cell', description:'Ironman Foam Cell provides the ultimate in 4x4 shock absorber design and features with 50% more oil for cooler running. Exceptional performance for both standard and raised height 4x4’s & superior ride control and comfort both on and off road is what you can expect from these shock absorbers. The shocks, designed by Ironman 4x4 suspension engineers, have been individually made component by component to produce the world’s finest offroad shock absorber. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'', specifications_attributes:[{title:'Package Details', value:'Each'}, {title:'Price Per Vehicle', value:'280'}], price:'154') if not '24795FE'.blank?;	vehicle2707 = Refinery::Ironman::Vehicle.find_by_name('100 Series');	product2707.vehicles << vehicle2707 if vehicle2707.present? and product2707.present?;	category2707 = Refinery::Ironman::Category.find_by_name('Shock Absorbers');	product2707.categories << category2707 if category2707.present? and product2707.present?
product2708 = Refinery::Ironman::Product.create!(product_no:'TOY050', name:'Landcruiser 100 Series Front Torsion Bars (Petrol)', description:'Ironman Torsion Bars are thicker than standard torsion bars fitted as original equipment. Original equipment torsion bars are designed to carry the weight of the vehicle as designed by their manufacturer. The adjustment incorporated in torsion bar vehicles is not intended to be used to compensate for carrying additional load. Additional 4x4 accessories such as a bull bar, winches and dual battery kit places enormous stress on standard torsion bars. Being uprated (thicker spring steel) Ironman torsion bars enhance ride comfort by controlling suspension travel whether carrying additional accessories or a full load of passengers. Ironman torsion bars will make your 4x4 safer while providing more comfortable cornering and braking efficiency. All Ironman torsion bars have upset forged ends and are pre set to minimise sag.', notes:'Must install BRACKET100|||Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.|||Suits Petrol Vehicles. Some middle easter vehicles may use longer torsion bars (TOY051), check length before ordering.', specifications_attributes:[{title:'Package Details', value:'Pair'}, {title:'Price Per Vehicle', value:'360'}], price:'396') if not 'TOY050'.blank?;	vehicle2708 = Refinery::Ironman::Vehicle.find_by_name('100 Series');	product2708.vehicles << vehicle2708 if vehicle2708.present? and product2708.present?;	category2708 = Refinery::Ironman::Category.find_by_name('Torsion Bars');	product2708.categories << category2708 if category2708.present? and product2708.present?
