product3084 = Refinery::Ironman::Product.create!(product_no:'12725GR', name:'Amarok 2010+ Front Strut - Nitro Gas', description:'Ironman 35mm bore Nitro Gas Shocks are the rugged all round 4x4 performance shock absorber. Ironman Nitro Gas Shocks provide exceptional performance for both standard and raised height 4x4’s whilst delivering superior ride control and comfort both on and off road. Improve stability when towing or carrying a load. Each and every Ironman shock absorber is force velocity tested before packaging to ensure all parts received are uniform and within operating specification. High quality materials such as German Fuchs High temp shock absorber fluid, Japanese NOK multilip seals are used. Strength and durability requirements are sorted by the use of re-enforced single piece eye rings and stems. Rubber shock absorber bushes are used by Ironman, this is to promote maximum flexibility and reduction in unwanted side load and NVH (Noise Vibration Harshness) transmission which often causes seal failures in other brand shock absorbers using Polyurethane.', notes:'Height Adjustable Spring Seat (with trim packer)|||Unnesessary fitment of trim packers may lift vehicle too high.|||Vehicles with independent suspension must maintain a minimum of 60mm downward suspension travel.', specifications_attributes:[{title:'Package Details', value:'Each'}, {title:'Price Per Vehicle', value:'300'}], price:'165') if not '12725GR'.blank?;	vehicle3084 = Refinery::Ironman::Vehicle.find_by_name('2010+');	product3084.vehicles << vehicle3084 if vehicle3084.present? and product3084.present?;	category3084 = Refinery::Ironman::Category.find_by_name('Shock Absorbers');	product3084.categories << category3084 if category3084.present? and product3084.present?
